import React, {  Component } from 'react';
import './App.css';
import { fetchMakeupData } from '../../ApiCalls/AipCalls'
import MakeupContainer from '../MakeupContainer/MakeupContainer';

class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      allMakeup: []
    }
  }

  componentDidMount = () => {
    fetchMakeupData()
      .then(makeupData => this.setState({...makeupData}))
  }

  render() {
    return (
      <div className="App">
        <MakeupContainer allMakeup={this.props.allMakeup}/>
      </div>
    );
  }
}


export default App;
